    var relationInfo=[];
    
    var personalInfo={
        gender:"GEN_"+nominee.gender,
        lastnm:nominee.lstNm,
        dob:nominee.dob,
        title:nominee.title,
        firstnm:nominee.frstNm
    }

        var obj={
        partytype:nominee.partytype+"",
        contactdetails:contDetls,
        addressinfo:addressInfo,
        partyseqid:nominee.partyseqid+"",
        additionalinfo:additionalInfo,
        relationshipinfo:relationInfo,
        personalinfo:personalInfo
    }
    nomineeArray.push(obj);

    })
    builderObject.body.nominee=nomineeArray;
}
outputs.request=builderObject;


})(inputs, outputs);

