sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
var healthDetails=inputs.clientRequest.healthDetails;
var builderObj=inputs.builderRequest;
var gr = new GlideRecord('x_rptp_smartinte_0_integration_question_configuration');
var arr = [];
gr.addQuery('insurer', 'ad07033affc3c29019a8ffda7c4fd95e');
gr.query();
while (gr.next()) {
    if(gr.getValue('code')){
    var obj = {
        insuranceCategory: gr.getDisplayValue('insurance_category'),
        insurer: gr.getDisplayValue('insurer'),
        questionCategory: gr.getDisplayValue('question_category'),
        product: gr.getDisplayValue('product'),
        code: gr.getValue('code'),
        answer: gr.getValue('answer_number'),
        question: gr.getValue('question'),
        id: gr.getValue('question_id'),
        subid: gr.getValue('sub_question_id'),
        qes_id:gr.getValue('hdfc_id')
    };
   
    arr.push(obj);
    }
}
var hdfcArray=[]
function filterByCode(arr, code) {
  return arr.filter(function(ques) {
    return ques.code === code;
  });
}
 healthDetails.forEach(function(question){
     var res=filterByCode(arr,question.code)
     if(res.length>0){
        var ans=false;
        var answer=[];
        var id;
         //  gs.addInfoMessage(JSON.stringify(res))
        
        res.forEach(function(element){
           // gs.addInfoMessage(JSON.stringify(resp))
            id=element.qes_id;
           if(element.answer=="answer1" && (question.answer1!="No" && question.answer1!="")){
            ans=true;
           }
            var value=question[element.answer];
           if(value!=""){
             if(value=="No"){
                value="N";
            }
            else if(value=="Yes"){
                value="Y";
            }
                answer.push(value);
           }
            
        });
        if(ans){
        var obj={
        "questionans":answer.join(","),
        "questionid":id
     }
     hdfcArray.push(obj); 
        }
     }
     });
builderObj.body.lifeassured[0].uwdetails=hdfcArray;

outputs.request=builderObj;

})(inputs, outputs);

